-- ItemTemplate ItemClass table
CREATE TABLE IF NOT EXISTS `itemtemplate_itemclass` (
  `itemTemplate` int(11) NOT NULL,
  `itemClass` int(11) NOT NULL,
  PRIMARY KEY (`itemTemplate`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


-- Random Name table
CREATE TABLE `random_name` (
  `name` varchar(45) NOT NULL,
  `type` varchar(45) NOT NULL,
  `gender` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`name`, `type`, `gender`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


-- Starter Items table
CREATE TABLE IF NOT EXISTS `starter_items` (
  `slotId` int(11) DEFAULT '20',
  `classId` int(11) NOT NULL,
  `templateId` int(11) DEFAULT NULL,
  `comment` char(50) DEFAULT NULL,
  PRIMARY KEY (`classId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

